import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { LoginComponent } from './components/login/login.component';
import {FormsModule} from "@angular/forms";
import { HttpClientModule } from '@angular/common/http';
import { StdUserComponent } from './components/std-user/std-user.component';
import { SprUserComponent } from './components/spr-user/spr-user.component';
import { ClockTimeComponent } from './components/clock-time/clock-time.component';
import { TimesheetComponent } from './components/timesheet/timesheet.component';
import { EditClockComponent } from './components/edit-clock/edit-clock.component';


@NgModule({
  declarations: [
    AppComponent,
    LoginComponent,
    StdUserComponent,
    SprUserComponent,
    ClockTimeComponent,
    TimesheetComponent,
    EditClockComponent
  ],
    imports: [
        BrowserModule,
        AppRoutingModule,
        FormsModule,
        HttpClientModule
    ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
